import React from "react";
import Navbar from "./components/Navbar";
import Home from "./components/home";
import About from "./components/about";
import { Switch, Route } from "react-router-dom";


const App = () => {
  return (
    <Switch>
      <Route exact path="/">
        <Home />
      </Route>

      <Route path="/about">
        <About />
      </Route>

      <Route path="/service">
        <Service />
      </Route>

      <Route path="/contact">
        <Contact />
      </Route>
    </Switch>
  );
};

export default App;
